// SPDX-License-Identifier: MIT
pragma solidity >=0.5.0 <0.7.1;

interface IHXYG {
  event GoldBought(address client, uint amount);
  event AddedToLequidityPool(address client, uint amount);
  event RemovedFromLequidityPool(address client, uint amount);

  function getClaimedDividends() external view returns(uint);

  function getDividendsPercentage() external view returns(uint);

  function getFeesPercentage() external view returns(uint);

  function getLQPoolBalance(address payable client) external view returns(uint);

  function getLastDividendsClaimDate(address payable client) external view returns(uint);

  function getLQPoolTotalValue() external view returns(uint);

  function getTotalBurnt() external view returns(uint);

  function balanceOf(address account) external view returns (uint256);

  function totalSupply() external view returns (uint256);

  function addToLqPool(uint256 initAmount) external;

  function withdrawFromLqPool(uint256 amount) external;

  function leaveLqPool() external;

  function claimDividends() external returns(uint);

  function calculateDividends() external view returns(uint);
}
